const CATEGORIES = [
    { id: 1, name: 'Cameras', icon },
    { id: 2, name: 'Monitors' },
    { id: 3, name: 'Printers' },
    { id: 4, name: 'Scanners' },
    { id: 5, name: 'MP3 Players' },
    { id: 6, name: 'Laptops' },
    { id: 7, name: 'Tablets' },
    { id: 8, name: 'Mobiles' },
    { id: 9, name: 'Web Cameras' },
    { id: 10, name: 'Headphones' },
];

export function getCategories() {
    return CATEGORIES;
}
